import React from 'react';
import './App.css';
import logo from './Color.png';
import { Helmet } from 'react-helmet';

function App() {
  return (
    <div>
      <Helmet>
        <title>Educate</title>
        <meta name="description" content="This is my React app" />
        <link rel="icon" href="/Color.png" type="image/x-icon" />
      </Helmet>
      <nav className="navbar">
            <div className="left">
                <img src={logo} width="200px"></img>
            </div>
            <div className="right">

                <ul className="list">
                    <li><a href="App.js">Home</a></li>
                    <li><a href="">About Us</a></li>
                    <li><a href="Learner_SignIn.html">Learner Login</a></li>
                    <li><a href="Educator_SignIn.html">Educator Login</a></li>
                    <li><a href="Contact_Us.html">Contact Us</a></li>
                </ul>
            </div>
        </nav>
      <header>
        <h1>Welcome to the Digital Education Platform</h1>
      </header>
    </div>
  );
}

export default App;
